import React, {
  useEffect,
  useRef,
  useState,
  useContext,
  TouchableOpacity,
} from "react";
import {
  StyleSheet,
  Animated,
  Text,
  View,
  TouchableHighlight,
  Button,
  Image,
} from "react-native";
import Geocoder from "react-native-geocoding";
import MapView, { Marker } from "react-native-maps";

import { useUserQuery, useAllRecordQuery } from "../queries";

import CreateNote from "../assets/icons/createNote.svg";
import TargetMarker from "../assets/markers/selectedMarker.svg";

import AppContext from "../components/AppContext";
import GoBackHeader from "../components/GoBackHeader";
import RecordMarker from "../components/MapScreen/RecordMarker";

const bottomSheetImage = require("../assets/image/bottomSheetScroll.png");
const mapStyle = require("../assets/mapDesign.json");

const toggleAnimation1 = (showAnimation, setAnimationValue) => {
  const val = -1000;
  Animated.timing(showAnimation, {
    useNativeDriver: false,
    toValue: val,
    duration: 350,
  }).start();
  setAnimationValue(val);
};
const toggleAnimation2 = (showAnimation, setAnimationValue) => {
  const val2 = 0;
  Animated.timing(showAnimation, {
    useNativeDriver: false,
    toValue: val2,
    duration: 350,
  }).start();
  setAnimationValue(val2);
};
const toggleAnimation3 = (showAnimation, setAnimationValue) => {
  const val3 = -692;
  Animated.timing(showAnimation, {
    useNativeDriver: false,
    toValue: val3,
    duration: 350,
  }).start();
  setAnimationValue(val3);
};

const BottomSheetScreen = ({
  showAnimation,
  animationVal,
  setAnimationValue,
  targetName,
  targetAddress,
  targetId,
  targetLctn,
  navigation,
}) => {
  const myContext = useContext(AppContext);
  const myUID = myContext.myUID;
  const userQuery = useUserQuery(myUID);
  const allRecordQuery = useAllRecordQuery();

  const gotoEditScreen = () => {
    return navigation.push("EditScreen", {
      placeName: targetName,
      placeID: targetId,
      address: targetAddress,
      lctn: targetLctn,
    });
  };

  if (animationVal < 0) {
    return (
      //bottomsheet가 전체 화면을 덮기 전
      <View
        style={{
          position: "absolute",
          width: "100%",
          height: "100%",
          flexDirection: "column",
        }}
      >
        <View
          style={{
            position: "absolute",
            width: "75%",
            height: "100%",
          }}
          onTouchEndCapture={() => {
            toggleAnimation2(showAnimation, setAnimationValue);
          }}
        >
          <Image
            source={bottomSheetImage}
            style={{ marginLeft: 175, marginTop: 8 }}
          />
          <Text
            style={{
              position: "absolute",
              marginTop: 24,
              marginLeft: 23,
              fontSize: 16,
              fontWeight: "bold",
            }}
          >
            {targetName}
          </Text>
          <Text
            style={{
              position: "absolute",
              marginTop: 56,
              marginLeft: 23,
              fontSize: 12,
              color: "#545766",
            }}
          >
            {targetAddress}
          </Text>
          <Text
            style={{
              position: "absolute",
              marginTop: 88,
              marginLeft: 23,
              fontSize: 12,
              color: "#ADB1C5",
            }}
          >
            기록{" "}
            {
              Object.values(
                allRecordQuery.data
                  ? Object.values(allRecordQuery.data).filter((record) => {
                      return record.folderID in userQuery.data?.folderIDs;
                    })
                  : []
              ).length
            }
          </Text>
        </View>
        <View
          style={{
            position: "absolute",
            right: 0,
            width: "25%",
            height: "8%",
          }}
          onTouchEndCapture={() =>
            toggleAnimation2(showAnimation, setAnimationValue)
          }
        />
        <View
          style={{
            position: "absolute",
            width: 48,
            height: 48,
            marginTop: 48,
            marginLeft: 319,
            alignItems: "center",
            justifyContent: "center",
          }}
        >
          <TouchableHighlight
            style={{
              position: "absolute",
              alignItems: "center",
              width: 48,
              height: 48,
              borderRadius: 24,
              zIndex: 1,
              bottom: 23,
            }}
            underlayColor="white"
            onPress={gotoEditScreen}
          >
            <CreateNote resizeMode="contain" />
          </TouchableHighlight>
        </View>
      </View>
    );
  } else {
    // TODO (@KhoDongwook) hook 루트로 빼기

    return (
      //bottomsheet가 전체 화면을 덮은 후
      <View
        style={{
          position: "absolute",
          width: "100%",
          height: "100%",
        }}
      >
        <GoBackHeader
          navigation={navigation}
          text={targetName}
          rightButton="goHome"
        />
        <View
          style={{
            position: "absolute",
            top: 30,
            left: 0,
            width: 60,
            height: 50,
            paddingTop: 5,
          }}
        />
        <View
          style={{ position: "absolute", top: 85, width: "100%", height: 600 }}
        >
          <RecordMarker
            recordDataSource={Object.values(
              allRecordQuery.data
                ? Object.values(allRecordQuery.data).filter((record) => {
                    return record.folderID in userQuery.data?.folderIDs;
                  })
                : []
            )}
          />
        </View>
        <TouchableHighlight
          style={{
            position: "absolute",
            bottom: 100,
            right: 10,
            alignItems: "center",
            width: 48,
            height: 48,
            borderRadius: 24,
            zIndex: 1,
          }}
          underlayColor="blue"
          onPress={gotoEditScreen}
        >
          <CreateNote resizeMode="contain" />
        </TouchableHighlight>
      </View>
    );
  }
};

const BottomSheet = ({
  showAnimation,
  animationVal,
  setAnimationValue,
  targetName,
  targetAddress,
  targetId,
  targetLctn,
  navigation,
}) => {
  return (
    <View>
      <Animated.View
        style={{
          width: "100%",
          height: 844,
          backgroundColor: "white",
          borderTopLeftRadius: 30,
          borderTopRightRadius: 30,
          position: "absolute",
          bottom: showAnimation,
          zIndex: 1,
          alignItems: "center",
          justifyContent: "center",
          borderWidth: 1,
          borderColor: "#DDDFE9",
          borderRadius: 16,
          elevation: 24,
        }}
      >
        <BottomSheetScreen
          showAnimation={showAnimation}
          animationVal={animationVal}
          setAnimationValue={setAnimationValue}
          targetName={targetName}
          targetAddress={targetAddress}
          targetId={targetId}
          targetLctn={targetLctn}
          navigation={navigation}
        />
      </Animated.View>
    </View>
  );
};

const MapSearchScreen2 = ({ navigation, route }) => {
  const [animationValue, setAnimationValue] = useState(0);

  const showAnimation = useRef(new Animated.Value(animationValue)).current;

  const mapRef = React.createRef();
  const [target, setTarget] = useState({
    lctn: {
      latitude: route.params.geometry.location.lat,
      longitude: route.params.geometry.location.lng,
    },
    latitudeDelta: 0.0016,
    longitudeDelta: 0.0012,
    name: route.params.name,
    address: route.params.address || route.params.formatted_address,
    id: route.params.id || route.params.place_id,
  });

  const [targetShown, setTargetShown] = useState(true);

  useEffect(() => {
    toggleAnimation3(showAnimation, setAnimationValue);
  }, []);
  useEffect(() => {
    if (targetShown === false)
      toggleAnimation1(showAnimation, setAnimationValue);
  }, [targetShown]);
  const targetingFromLocation = (lctn, name) => {
    Geocoder.from(lctn)
      .then((json) => {
        const addressComponent = json.results[0].formatted_address;
        setTarget({
          lctn: { latitude: lctn.latitude, longitude: lctn.longitude },
          latitudeDelta: 0.0016,
          longitudeDelta: 0.0012,
          name,
          address: addressComponent,
          id: json.results[0].place_id,
        });
        setTargetShown(true);
      })
      .catch((error) => console.warn(error));
    toggleAnimation3(showAnimation, setAnimationValue);
  };

  return (
    <View>
      <GoBackHeader
        navigation={navigation}
        text={target.name}
        rightButton="goHome"
      />
      <MapView
        customMapStyle={mapStyle}
        provider="google"
        ref={mapRef}
        style={styles.map}
        region={{
          latitude: target.lctn.latitude,
          longitude: target.lctn.longitude,
          latitudeDelta: 0.0016,
          longitudeDelta: 0.0012,
        }}
        onPoiClick={(data) => {
          targetingFromLocation(
            data.nativeEvent.coordinate,
            data.nativeEvent.name.split("\n")[0]
          );
        }}
        onPress={({ nativeEvent }) => {
          if (
            nativeEvent.action === "marker-press" &&
            nativeEvent.coordinate.latitude === target.lctn.latitude &&
            nativeEvent.coordinate.longitude === target.lctn.longitude
          ) {
            setTargetShown(true);
          } else {
            setTargetShown(false);
          }
        }}
      >
        <Marker
          coordinate={target.lctn}
          opacity={targetShown ? 100 : 0}
          style={{ position: "relative" }}
        >
          <TargetMarker />
        </Marker>
      </MapView>

      <BottomSheet
        showAnimation={showAnimation}
        animationVal={animationValue}
        setAnimationValue={(val) => setAnimationValue(val)}
        targetName={target.name}
        targetAddress={target.address}
        targetId={target.id}
        targetLctn={target.lctn}
        navigation={navigation}
      />
    </View>
  );
};

const styles = StyleSheet.create({
  container: {
    width: "100%",
    height: "100%",
    flexDirection: "row",
    justifyContent: "space-between",
    position: "relative",
    backgroundColor: "white",
  },
  map: {
    width: "100%",
    height: 756,
    marginTop: 0,
  },
  buttons: {
    height: 88,
    width: "100%",
    backgroundColor: "#fff",
    flexDirection: "row",
    position: "absolute",
  },
  goBack: {
    width: 30,
    height: 18,
    position: "absolute",
    marginTop: 51,
    marginLeft: 31,
  },
  goBackImage: {
    width: 9,
    height: 18,
    resizeMode: "contain",
    tintColor: "black",
  },
  title: {
    width: 280,
    height: 24,
    marginTop: 48,
    marginLeft: 63,
    position: "absolute",
  },
  titleText: {
    height: 24,
    fontSize: 16,
    lineHeight: 24,
  },
  goHome: {
    width: 15,
    height: 15,
    marginLeft: 347.5,
    marginTop: 52.5,
  },
  goHomeImage: {
    width: 15,
    height: 15,
    position: "absolute",
  },
  goHomeImage2: {
    width: 15,
    height: 15,
    position: "absolute",
  },
});

export default MapSearchScreen2;
/** */
